      out.write("\t\tfunction generateId(){\r\n");
      out.write("\t\t\tvar d = new Date(),str = '';\r\n");
      out.write("\t\t\tstr += d.getFullYear();\r\n");
      out.write("\t\t/* \tstr  += d.getMonth() + 1; */\r\n");
      out.write("\t\t\tif(d.getMonth()+1 <10){\r\n");
      out.write("\t\t\t\tstr += \"0\";\r\n");
      out.write("\t\t\t\tstr  += d.getMonth() + 1;\r\n");
      out.write("\t\t\t}else{\r\n");
      out.write("\t\t\t\tstr  += d.getMonth() + 1;\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t\tstr  += (d.getDate() > 9 ? d.getDate() : \"0\"+ d.getDate());\r\n");
      out.write("\t\t\tstr += (d.getHours() >9 ? d.getHours() : \"0\"+ d.getHours());\r\n");
      out.write("\t\t\tstr  += (d.getMinutes() >9 ? d.getMinutes() : \"0\"+ d.getMinutes());\r\n");
      out.write("\t\t\tstr += (d.getSeconds() >9 ? d.getSeconds() : \"0\"+ d.getSeconds());\r\n");
      out.write("\t\t\tstr += d.getMilliseconds();\r\n");
      out.write("\t\t\tvar id = str;\r\n");
      out.write("\t\t\treturn id;\r\n");
      out.write("\t\t}\r\n");
